import { Checkbox } from "@material-ui/core";
import React from "react";
import "./EmailList.css";

function EmailList() {
  return (
    <div className="emailList">
      <div className="emailList__settings">
        <div className="emailList__settingsLeft">
          <Checkbox />
        </div>
      </div>
    </div>
  );
}

export default EmailList;
